import Link from "next/link";
import Head from "next/head";

const Index = () => (
  <div>
    <Head>
      <title>Index</title>
    </Head>
    Hello from Next.js
    <Link href="/about">
      <a>About</a>
    </Link>
  </div>
);

export default Index;
